(1, '阿凡达：水之道', '杰克·萨利与奈蒂莉组建了家庭，他们的孩子也逐渐成长。然而某一天，有个部族的兄弟遭到了天空人的残酷杀害。', 'https://image.tmdb.org/t/p/w500/t6HIqrRAclMCA60NsSmeqe9RmNV.jpg', 'https://image.tmdb.org/t/p/w1280/s16H6tpK2utvwDtzZ8Qy4qm5Emw.jpg', 2022, '8.1', 'movie', 'released', 192, '詹姆斯·卡梅隆', 2320000000, NULL, NULL, NULL, NULL, '2022-12-16 00:00:00', '2022-12-16 00:00:00', NULL, NULL, NULL, NULL),
(2, '黑豹：瓦坎达万岁', '瓦坎达王国正努力保护自己的国家不受世界强国的干预。', 'https://image.tmdb.org/t/p/w500/sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 'https://image.tmdb.org/t/p/w1280/yYrvN5WFeGYjJnRzhY0QXuo4Isw.jpg', 2022, '7.3', 'movie', 'released', 161, '瑞恩·库格勒', 859000000, NULL, NULL, NULL, NULL, '2022-11-11 00:00:00', '2022-11-11 00:00:00', NULL, NULL, NULL, NULL),
(3, '壮志凌云：独行侠', '经过三十多年的服役，皮特·米切尔仍然是一名顶尖的飞行员。', 'https://image.tmdb.org/t/p/w500/62HCnUTziyWcpDaBO2i1DX17ljH.jpg', 'https://image.tmdb.org/t/p/w1280/odJ4hx6g6vBt4lBWKFD1tI8WS4x.jpg', 2022, '8.5', 'movie', 'released', 130, '约瑟夫·科辛斯基', 1488000000, NULL, NULL, NULL, NULL, '2022-05-27 00:00:00', '2022-05-27 00:00:00', NULL, NULL, NULL, NULL),
(4, '奇异博士2：疯狂多元宇宙', '奇异博士在无限战争中展望了1400万个可能的未来，只有一个能战胜灭霸。', 'https://image.tmdb.org/t/p/w500/9Gtg2DzBhmYamXBS1hKAhiwbBKS.jpg', 'https://image.tmdb.org/t/p/w1280/wcKFYIiVDvRURrzglV9kGu7fpfY.jpg', 2022, '7.0', 'movie', 'released', 126, '山姆·雷米', 956000000, NULL, NULL, NULL, NULL, '2022-05-06 00:00:00', '2022-05-06 00:00:00', NULL, NULL, NULL, NULL),
(5, '雷神4：爱与雷霆', '雷神踏上了一次前所未有的旅程：寻找内心的平静。', 'https://image.tmdb.org/t/p/w500/pIkRyD18kl4FhoCNQuWxWu5cBLM.jpg', 'https://image.tmdb.org/t/p/w1280/p1F51Lvj3sMopG948F5HsBbl43C.jpg', 2022, '6.8', 'movie', 'released', 119, '塔伊加·维迪提', 760000000, NULL, NULL, NULL, NULL, '2022-07-08 00:00:00', '2022-07-08 00:00:00', NULL, NULL, NULL, NULL),
(6, '蜘蛛侠：纵横宇宙', '迈尔斯·莫拉莱斯重新投入到蜘蛛侠的身份中，但被大批蜘蛛侠追杀。', 'https://image.tmdb.org/t/p/w500/8Vt6mWEReuy4Of61Lnj5Xj704m8.jpg', 'https://image.tmdb.org/t/p/w1280/nGxUxi3PfXDRm7Vg95VBNgNM8yc.jpg', 2023, '8.7', 'movie', 'released', 140, '华金·多斯·桑托斯', 690000000, NULL, NULL, NULL, NULL, '2023-06-02 00:00:00', '2023-06-02 00:00:00', NULL, NULL, NULL, NULL),
